import React from 'react';
import { PageContainer, FormContainer, InputField, SubmitButton, FormTitle, FormText, FormLink } from './LoginSignupStyles';
import CheckoutButton from '/Users/ismaelanwarzai/Desktop/SOTD/CheckoutButton.js'; // Import the payment button

const LoginPage = () => {
  return (
    <PageContainer>
      <FormContainer>
        <FormTitle>Login</FormTitle>
        <form>
          <InputField type="email" placeholder="Email" required />
          <InputField type="password" placeholder="Password" required />
          <SubmitButton type="submit">Login</SubmitButton>
        </form>
        <FormText>
          Don't have an account? <FormLink to="/signup">Sign Up</FormLink>
        </FormText>
        <CheckoutButton /> {/* Add payment button */}
      </FormContainer>
    </PageContainer>
  );
};

export default LoginPage;
